import Sachin16 from './Sachin16';
import { useState } from 'react';

// import logo from './logo.svg';
// import './App.css';
import Cl from './Cl';
function App() {

  var [data,sachin]=useState("rakht")
  var [data1,radhe]=useState("545445454545")
  function change(){
    sachin("pravin")
    radhe("6268998244")
  }

  return (
    <div>
    <Cl></Cl>
    <Sachin16 name={data} Number={data1}></Sachin16>
    <button onClick={change}>OK</button>

    </div>
  );
}

export default App;
